syntax = "proto3";

message Data {
  repeated Highest highest = 1;
  Stats stats = 2;
}

message Highest {
  int32 count = 1;
  double desirability = 2;
  double distcc = 3;
  double meanGradient = 4;
  double meanMeans = 5;
  string suburb = 6;
}

message Stats {
  double IQR = 1;
  double Max = 2;
  double Min = 3;
  double Q1 = 4;
  double Q3 = 5;
  double median = 6;
}

